import React from "react";
import { Link } from "react-router-dom";
import "./styles.css";
import "./bootstrap.min.css";
import logo from "./capable_logo.png";
import { CgFileDocument } from "react-icons/cg"
import { ImNewspaper } from "react-icons/im"
import { BsPeopleFill } from "react-icons/bs"

export default class Navbar extends React.Component {
    render() {
        return (
            <nav className="Nav">
                <ul className="navbar-nav">
                    <li className="nav-item">
                    <Link className="nav-link" to="/Home">
                        <img class="nav-logo" src={logo} alt={logo} />
                    </Link>
                    </li>
                    <li className="nav-item">
                    <Link className="nav-link" to="/Dashboard">
                        <div className="link-color"><ImNewspaper /> Dashboard</div>
                    </Link>
                    </li>
                    <li className="nav-item">
                    <Link className="nav-link" to="/Patients">
                        <div className="link-color"><BsPeopleFill /> Patients</div>
                    </Link>
                    </li>
                    <li className="nav-item">
                    <Link className="nav-link" to="/Documentation">
                        <div className="link-color"><CgFileDocument /> Documentation</div>
                    </Link>
                    </li>
                </ul>
            </nav>
        );
    }
}
